vector<vector<int>> fdtd_2d_part1(
    int nx,
    int ny,
    vector<vector<int>> ey,
    vector<vector<int>> hz
) {
return matrix_row_slice(matrix_elemwise_sub(matrix_row_slice(ey, 1, nx), matrix_scalar_mul(5, matrix_elemwise_sub(matrix_row_slice(hz, 1, nx), matrix_row_slice(hz, 0, nx - 1)))),0,nx-1);
}
